import './PokeCard.css';

function PokeCard() {
  
  const pokemon ={
    elementTypes:'water',
    name:'Ronaldo',
    id:27,
    ClassNames:'card' + elementTypes,
    CardSubtitle: 'Plant|Poisonous'
  }
  
  const elementTypes = 'water';
  const name = 'ronaldo';
  const id = 29;
  const ClassNames = 'card' + elementTypes
  const CardSubtitle = 'Plant|Poisonous'

  return (
    <li className={['card {elementTypes}']}>
        <img class="card-image "alt ="${name}" src="https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/29.png" />
        <h2 class="card-title"> {id}. {name}</h2>
        <p class="card-subtitle">{CardSubtitle}</p>
    </li>
  );
}

export default PokeCard;
